export default function PostCabin (props) {
    return(
        <div>
            <p>Hello from PostCabin</p>
            <button id='cabin-button'>Legg til hytte</button>
            <script>
                {document.getElementById('cabin-button').addEventListener('click', event => {
                    const options = {
                        method: 'POST',
                        headers : {
                        'Content-Type': 'application/json'
                        },
                        body: JSON.stringify(contactPage)

                    }
                    fetch('/cabins', options)
                        .then(response => response.json())
                        .then(data => {
                        console.log(data);
                    })
                })} 
            </script>         
        </div>
    )
}
